int dp[20][20];
class Solution {
public:
    int trees(int i, int j){
        if(i >= j)
            return 1;
        if(dp[i][j] != 0)return dp[i][j];
        int ans = 0;
        for(int k = i;k<=j;k++){
            ans += trees(i,k - 1) * trees(k + 1,j);
        }
        return dp[i][j] = ans;
    }
    int numTrees(int n) {
        return trees(1,n);
    }
};
